"""# Problem 2(d)

### Function returns the eigenvalues and eigenvectors
"""

def W(sigma,input):
  #sigma = 0.1
  #input = dataset
  dataf = pd.DataFrame(input,columns=['X','Y','Z'])
  input_data = distance_matrix(dataf.values,dataf.values)
  W = np.exp(-1*(np.square(input_data)/np.square(sigma)))
  return W

def graph_la(sigma, input):
  matrix = np.array(input)
  # calculate degree matrix
  D = np.diag(np.sum(matrix, axis=1))
  L = D-W(sigma,input)
  eigenvalues, eigenvectors = np.linalg.eig(L)
  return eigenvectors, eigenvalues

graph_la(0.1, dataset)

